// src/components/Header.js
import React from 'react';
import { Link } from 'react-router-dom';
import logo from '../Assets/logo.svg';

const Header = () => {
  return (
    <nav className="-navigation">
      <img src={logo} alt="Tranquil Travels Logo" className="logo" />
      <ul className="nav-links">
        <li><Link to="/" className="nav-link">Home</Link></li>
        <li><Link to="/offers" className="nav-link">Find offers</Link></li>
        <li><Link to="/add" className="nav-link">Add new offers</Link></li>
        <li><Link to="/my-offers" className="nav-link">My offers</Link></li>
        <li><Link to="/favorites" className="nav-link">Favorites</Link></li>
      </ul>
      <button className="button primary">Log out</button>
    </nav>
  );
};

export default Header;
